let routes = [
    {
        path: '/login',
        name: '登录',
        exact: true,
        component: '../views/login/login'
    },
    {
        path: '/',
        name: '首页',
        exact: true,
        component: '../views/home/home'
    },
    {
        path: '/user',
        name: '用户',
        component: '../views/user/user',
        routes: [   /*嵌套路由*/
            {
                path: "/user/",
                component: '../components/User/UserList'
            },
            {
                path: "/user/add",
                component: '../components/User/UserAdd'
            },
            {
                path: "/user/edit",
                component: '../components/User/UserEdit'
            }
        ]
    },
    {
        path: '/shop',
        name: '商店',
        component: '../views/shop/shop',
    },
]
export default routes;
